import React from "react";



function Restaurant({restaurant}){
  return(
    <div className="card dishes" style={{width: "18rem"}}>
      <img src={`data:image/jpeg;base64,${restaurant.picture}`} className="card-img-top" alt="dish-img" />
      <div className="card-body">
        <h5 className="card-title">{`${restaurant.restaurantName}`}</h5>
        <h5 className="card-text">{`${restaurant.location}`}</h5>
        <h5 className="card-text">{`${restaurant.description}`}</h5>
        <h5 className="card-text">{`${restaurant.timings}`}</h5>
      </div>
    </div>
  )
}

export default Restaurant;
